import React, { Component } from 'react';
import { PieChart, Pie, Tooltip } from 'recharts';

class DashboardTeste extends Component {

    render() {
        const data = [
            { name: "Facebook", value: 200000 },
            { name: "Instagram", value: 200000 },
            { name: "Twiter", value: 200000 },
        ]
        return (
            <>
                <div className="conteiner">
                    <div className="row">
                        <div className='col-lg-12'>
                            <h3>Social Media</h3>

                            <PieChart width={400} height={400}>
                                <Pie
                                    dataKey="value"
                                    isAnimationActive={false}
                                    data={data}
                                    cx="50%"
                                    cy="50%"
                                    outerRadius={80}
                                    fill="#8884d8"
                                    label
                                />
                                <Tooltip />
                            </PieChart>
                        </div>
                    </div>
                </div>

            </>
        );
    }
}

const mapStateToProps = (state) => {

    return {
  
      requisicaos: state.requisicaos,
  
    };
  
  };

export default connect(mapStateToProps, { retrieveNrequisicaos, deleteNrequisicao })(DashboardTeste);
